const formatToParts = (value, locale, opts) => {
  const formatter = new Intl.NumberFormat(locale, opts);
  const parts = formatter.formatToParts(value);
  parts.forEach(p => {
    if (p.type == 'group') p.value = '_';
  });
  return parts;
};

